import React from 'react';

function RightSection({imageUrl,productName,productDescription,linkurl,linkname }) {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col-8 p-3'>
                    <h2 className='pb-2 pt-3'>{productName}</h2>
                    <p className='text-muted lh-base' style={{fontSize: '17px'}}>
                        {productDescription} </p>
                    <div className='pb-4  fw-semibold'>
                        <a href={linkurl} style={{textDecoration: 'none'}}>
                            {linkname}
                        </a>
                    </div>
                </div>
                 <div className='col-4 p-3'> <img src={imageUrl} alt={productName} className="img-fluid" /></div>
            </div>
        </div>
     );
}

export default RightSection;
